// import './App.css';
import React from "react";
import { Router, Route, Routes, Navigate, BrowserRouter } from "react-router-dom";
import HomePage from './components/home/HomePage.js';
import LoginPage from "./components/login/Login.js";
import SignupPage from "./components/signup/SingupPage.js";
import AuthProvider, { ContextProvider } from "./context/AuthContext.js";
import PrivateRoute from "./context/PrivateRoute.js";



const App = () => {

  // const RequireAuth = ({ children }) => {
  //   return currentUser ? children : <Navigate to="/login" />
  // }

  return (
    <BrowserRouter>
    <ContextProvider></ContextProvider>
      <Routes>
        <Route path="/login" Component={LoginPage} />
        <PrivateRoute exact path="/" Component={HomePage} />
        <Route path="/Home" Component={HomePage} />
        <Route path="/singup" Component={SignupPage} />
      </Routes>
    </BrowserRouter>
  )
}

export default App;
